  \"access_constraints\",\n\t\t\"value\": \"[\"Use Constraints: The hardcopy FIRM
  and FIRM Database and the accompanying FIS are the official designation of SFHAs
  and Base Flood Elevations (BFEs) for the NFIP. For the purposes of the NFIP, changes
  to the flood risk information published by FEMA may only be performed by FEMA and
  through the mechanisms established in the NFIP regulations (44 CFR Parts 59-78).
  These digital data are produced in conjunction with the hardcopy FIRMs and generally
  match the hardcopy map exactly. Acknowledgement of FEMA would be appreciated in
